import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
      <div className="App">
        <header className="App-header">
          <div>IP Address</div>
        </header>
        <article className="App-article">
          <div>Hello</div>
        </article>
        <footer className="App-footer">
          <div>Script by Mongkol Thamwongskul. Powered by React.</div>
        </footer>
      </div>
    )
  };

export default App;
